  return (

    <Router>
       <div>
         <Route path="/" render={props =>(

           <React.Fragment>
            <AddProject addproject={this.addproject}/>
            <AddResource addresource={this.addresource}/>
           </React.Fragment>

         )}/>
       <Route path="/addproject" components={Addproject}/>
    </div>
    </Router>
  );
}

export default App;
